import propTypes from 'prop-types'

function Content(props) {
    return <h1>Content section {props.username} {props.phone}</h1>
}

Content.defaultProps = {
    username: 'nitinnitin',    /* Props Default Value */
    phone: '909090'
}

Content.propTypes = {
    username: propTypes.string  /* define datatype--> array, bool, func, number, object, string, symbol  */
}


export default Content
